import React, { useState, startTransition } from 'react';
import { useNavigate, Routes, Route } from 'react-router-dom';
import navLogo from '../../navLogo.jpg';
import './navbar.css';

// Lazy-loaded components
const LazyAssetEntryInfoForm = React.lazy(() => import('../assetEntryInfo/assetEntryInfo.js'));
const LazyAssetRegistrationForm = React.lazy(() => import('../assetRegistration/assetRegistration.js'));
const LazyAssetDeviceMappingForm = React.lazy(() => import('../assetDeviceMapping/assetDeviceMapping.js'));
const LazyAssetDriverMapping = React.lazy(() => import('../assetDriverMapping/assetDriverMapping.js'));
const LazyDeviceEntryForm = React.lazy(() => import('../deviceEntry/deviceEntry.js'));
const LazyDriverRegistrationForm = React.lazy(() => import('../driverRegistration/driverRegistration.js'));
const LazyEntityCreationForm = React.lazy(() => import('../entityCreation/entityCreation.js'));
const LazyTransporterCreationForm = React.lazy(() => import('../transporterCreation/transporterCreation.js'));
const LazyPortDeviceMappingForm = React.lazy(() => import('../portDeviceMapping/portDeviceMapping.js'));
const LazyServiceDataLogForm = React.lazy(() => import('../serviceDataLog/serviceDataLog.js'));

const Navbar = () => {
  const navigate = useNavigate();
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleFormClick = (path) => {
    startTransition(() => {
      navigate(path);
    });
    setIsDropdownOpen(false); // Close dropdown after clicking an option
  };

  const openDropdown = () => {
    setIsDropdownOpen(true);
  };

  const closeDropdown = () => {
    setIsDropdownOpen(false);
  };

  return (
    <div className='navbar-main'>
      <div className='logo-container'>
        <img src={navLogo} alt='Logo' className='logo' />
        <div className='brand-text'>
          <span>NavitronicX</span>
        </div>
      </div>
      <div className='menu-container' onMouseEnter={openDropdown} onMouseLeave={closeDropdown}>
        <button className='menu-button'>Menu</button>
        {isDropdownOpen && (
          <div className='dropdown-content'>
            <Routes>
              <Route path="/entityCreation" element={<LazyEntityCreationForm />} />
              <Route path="/transporterCreation" element={<LazyTransporterCreationForm />} />
              <Route path="/assetEntryInfo" element={<LazyAssetEntryInfoForm />} />
              <Route path="/assetRegistration" element={<LazyAssetRegistrationForm />} />
              <Route path="/assetDeviceMapping" element={<LazyAssetDeviceMappingForm />} />
              <Route path="/deviceEntry" element={<LazyDeviceEntryForm />} />
              <Route path="/driverRegistration" element={<LazyDriverRegistrationForm />} />
              <Route path="/assetDriverMapping" element={<LazyAssetDriverMapping />} />
              <Route path="/portDeviceMapping" element={<LazyPortDeviceMappingForm />} />
              <Route path="/serviceDataLogForm" element={<LazyServiceDataLogForm />} />
            </Routes>
          </div>
        )}
        {/* Menu options */}
        {isDropdownOpen && (
          <div className='menu-options'>
            <button onClick={() => handleFormClick('/entityCreation')}>
              Entity Registration
            </button>
            <button onClick={() => handleFormClick('/transporterCreation')}>
              Transporter Registration
            </button>
            <button onClick={() => handleFormClick('/assetEntryInfo')}>
              Asset Info Entry
            </button>
            <button onClick={() => handleFormClick('/assetRegistration')}>
              Asset Registration
            </button>
            <button onClick={() => handleFormClick('/assetDeviceMapping')}>
              Asset Device Mapping
            </button>
            <button onClick={() => handleFormClick('/assetDriverMapping')}>
              Asset Driver Mapping
            </button>
            <button onClick={() => handleFormClick('/deviceEntry')}>
              Device Entry
            </button>
            <button onClick={() => handleFormClick('/driverRegistration')}>
              Driver Registration
            </button>
            <button onClick={() => handleFormClick('/portDeviceMapping')}>
              Port Device Mapping
            </button>
            <button onClick={() => handleFormClick('/serviceDataLog')}>
              Service Data Log
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default Navbar;
